'''),
    "designTextItalics" : MessageLookupByLibrary.simpleMessage('''"El Parque del Abeto parece admirablemente adaptado para un Pere la Chaise, que armonizaría maravillosamente con el paisaje adyacente, y constituiría un apéndice solemne y apropiado a la venerable estructura (la Catedral) frente a la cual, mientras que ofrecerá un alojamiento muy deseado para las clases altas, al mismo tiempo, convertiría una propiedad improductiva en una fuente de lucro general y lucrativa, en una institución caritativa ", debía ser" respetuoso con los muertos, seguro y sanitario para los vivos, dedicado al Genio de Memoria y para extender el sentimiento religioso y moral."
'''),
    "designText2" : MessageLookupByLibrary.simpleMessage('''La Casa de los Comerciantes le pidió al arquitecto David Hamilton, Stuart Murray, Curador del Jardín Botánico, y James Clelland, Superintendente de Obras Públicas, que produjeran un estudio de viabilidad para formar la Necrópolis de Glasgow y en 1828 el comité de Directores de Tierras y Canteras acordó la propuesta. En 1831, se publicó en los periódicos un concurso para convertir el Abeto Park en un cementerio con 5 premios de £ 10 - £ 50. Se recibieron dieciséis planes y se exhibieron en las salas de exhibición de la Sociedad Dilettante en Argyll Arcade. David Bryce de Edimburgo ganó el primer premio y su hermano John Bryce de Glasgow el segundo. Sin embargo, los jueces decidieron que el trabajo lo realizaría mejor un jardinero paisajista. Como resultado, George Mylne fue nombrado Superintendente y jefe de jardineros y comenzó el trabajo.
'''),
    "victorian" : MessageLookupByLibrary.simpleMessage('''La necrópolis victoriana de Glasgow
'''),
    "victorianText" : MessageLookupByLibrary.simpleMessage('''Este cementerio siempre tuvo la intención de ser interdenominacional y el primer entierro en 1832 fue el de un judío, Joseph Levi, un joyero. En 1833, el primer entierro cristiano fue de Elizabeth Miles, madrastra del superintendente, George Mylne. Después de 1860, las primeras extensiones al este y al sur tomarían la cantera Ladywell y en 1877 y 1892/3, se construyeron las extensiones finales al norte y sureste, duplicando el tamaño del cementerio. La Necrópolis tiene ahora 37 acres (15 ha).

Se han realizado 50,000 entierros en la Necrópolis y la mayoría de las 3,500 tumbas se han construido hasta 14 pies de profundidad, con paredes de piedra y tabiques de ladrillo. En la parte superior de las tumbas de la necrópolis se destruyeron las rocas. En 1877, la Quemadura de Molendinar, que se ejecuta bajo el Puente de los Suspiros, fue enterrada. Esta quemadura en la que se decía que San Mungo había pescado salmón ahora está bajo tierra en su camino hacia el Clyde.

La Necrópolis fue uno de los pocos cementerios en mantener registros de los muertos, incluida la profesión, las edades, el sexo y la causa de la muerte. En julio de 1878, el libro de visitantes muestra que 13.733 personas visitaron la Necrópolis de Glasgow: 12.400 ciudadanos y 1.333 visitantes más.

En 1966, la Casa de los Comerciantes entregó la Necrópolis al Ayuntamiento de Glasgow, que ahora la administra y mantiene. Se han eliminado los bancos y los alrededores de las tumbas y la mayor parte del área se ha colocado en el césped con fines de mantenimiento. Aquí hay monumentos diseñados por los principales arquitectos y escultores de la época, incluidos Alexander "Griego" Thomson, Charles Rennie Macintosh y JT Rochead, en todos los estilos arquitectónicos, creados para los empresarios prominentes y ricos de la "Segunda Ciudad del Imperio".

La necrópolis de Glasgow todavía tiene un ambiente maravilloso y todavía atrae a muchos visitantes tanto a nivel local como de todo el mundo.'''),
